  font-family: "IconFamily";
  content: "\e9e4";
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%) scale(0);
  color: #56535f;
  font-size: 16px;
  font-weight: bold;
  transition: cubic-bezier(0.53, 0, 0.52, 1) transform 200ms;
}

input[type=checkbox]:checked::after {
  transform: translate(-50%, -50%) scale(1);
}

input[type=checkbox]:focus {
  outline: none;
  box-shadow: inset -1px -1px 2px rgba(200, 208, 231, 0.15), inset 1px 1px 2px #FFF, -1px -1px 3px #FFF, 0.5px 0.5px 1.5px rgba(129, 141, 160, 0.3);
